import './Blog.css';

export default function Blog() {
    return (
        <div className="blog">
            <span style='font-size:100px;'>&#127881;</span>
            <h1 className="title">Blog</h1>
            <span style='font-size:100px;'>&#127881;</span>
            <article>
                <h2 className="article-title">GRAND OPENING</h2>
                <h2>The Gym Pod @ Bukit Merah Central</h2>
                <p>Opening on June 14, The Gym Pod @ 163 Bukit Merah Central welcomes people from all walks of life to improve their health by exercising in comfort!</p>
            </article>
        </div>
    )
}
